import React, { useState } from 'react';

const Results = ({ options, onSelect }) => {
  const [f1ScoreList, setF1ScoreList] = useState([]);
  const [showF1ScoreList, setShowF1ScoreList] = useState(false);

  const generateF1Scores = () => {

    fetch('/f1score')
      .then((response) => response.json())
      .then((data) => {
        setF1ScoreList(data.f1_score_all);
        setShowF1ScoreList(true);
      })
      .catch((error) => {
        console.error('Error generating F1 scores:', error);
      });
  };

  return (
    <div className="grid-dropdown">
      <button onClick={generateF1Scores}>Generate F1 Scores</button>

      {showF1ScoreList && (
        <div>
          <h3>F1 Scores:</h3>
          <ul>
            {f1ScoreList.map((score, index) => (
              <li key={index}>{score}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Results;
